def translateCoords(x, y):
    data = np.array([x, y])
    data_local = t(data)
    
    # Format the coordinates into a tuple
    data_local = (int(data_local[0][0]), int(data_local[0][1]))

    return data_local

def returnCoords(event, x, y, flags, param):
    if event == cv2.EVENT_LBUTTONDOWN:
        print(x, y)

cv2.namedWindow("video")
cv2.setMouseCallback("video", returnCoords)

def videoOverlay(vid_name):
    #cap = cv2.VideoCapture(vid_name)
  
    count = 0
    frame_count = 0
    frames_passed = 0
    stored_x_coord = 0
    stored_y_coord = 0
    #while(True):
    while fvs.more():
        # Capture frames in the video
        #ret, frame = cap.read()
        frame = fvs.read()

        fps = fvs.stream.get(cv2.CAP_PROP_FPS)

        # This delay code does not get it to the appropriate speed
        #delay = int(1000/fps)

        # Time passed in video
        time_passed = frame_count / fps

        # describe the type of font
        # to be used.
        font = cv2.FONT_HERSHEY_SIMPLEX
        # Use putText() method for
        # inserting text on video
        cv2.putText(frame, 'T', (60, 420), font, 1, (0, 255, 255), 2, cv2.LINE_4)

        # Wait until 3 seconds have passed before we start overlaying the data
        if time_passed < 9:
            pass
        else:
            if frames_passed > 2:
                # Put the number 564 on top of the translated coords
                cv2.putText(frame, '564', translateCoords(xData[count], yData[count]), font, 1, (0, 255, 255), 2, cv2.LINE_4)
                count += 1
                frames_passed = 0
            else:
                # Put the number 564 on top of the stored coords
                cv2.putText(frame, '564', translateCoords(stored_x_coord, stored_y_coord), font, 1, (0, 255, 255), 2, cv2.LINE_4)

        # Display the resulting frame
        cv2.imshow('video', frame) 
        # creating 'q' as the quit 
        # button for the video
        if cv2.waitKey(25) & 0xFF == ord('q'):
            break

        frame_count += 1
        frames_passed += 1
        stored_x_coord = xData[count]
        stored_y_coord = yData[count]
    # release the cap object
    #cap.release()
    # close all windows
    cv2.destroyAllWindows()
    fvs.stop()

